"Jogo de campeonato é bola pro mato".

 @papadordebotafoguense5571  O cara é telespectador, tem todo o direito de achar bom ou ruim. Se ela ganha x ou y, pouco importa, até pq creio que ela não paga a conta de ninguém aqui. 
Quer dizer então que ninguém pode reclamar de um jogador, só pq ele ganha bem, mesmo que esteja fazendo um péssimo papel em campo?

Ah, cara. Vai lamber sabão.
